#Comenzaremos importanto nuesto csv, para comenzar con el análisis del año  2023
import pandas as pd
df_2023 = pd.read_csv('/content/ROBO_TRANSEUNTE_EN_VIA_PUBLICA_CON_VIOLENCIA_2023.csv')
df_2023.head()

# Agrupamos el DataFrame por las columnas 'colonia' y 'mes' para calcular cuántos delitos ocurrieron en cada combinación
# Utilizamos el método .groupby() para crear estas agrupaciones.
# Luego, el método .size() cuenta el número de filas en cada grupo, que corresponde al número de delitos.
# reset_index() convierte el resultado en un nuevo DataFrame y agrega una columna llamada 'numero de delitos' para guardar estos conteos.
delitos_por_mes_colonia = df_2023.groupby(['colonia', 'mes']).size().reset_index(name='numero de delitos')

# Calculamos el número máximo de delitos registrados en un mes en todas colonia.
# Usamos .max() en la columna 'numero de delitos' del DataFrame resultante.
max_delitos = delitos_por_mes_colonia['numero de delitos'].max()
# Imprimimos el resultado para informar cuál fue el mayor número de delitos por mes y colonia.
print("El mayor número de delitos por mes y colonia, en la alcaldía Cuauhtémoc fue de:", max_delitos)

# Calculamos el número mínimo de delitos registrados en un mes todas las colonia.
# Usamos .min() en la columna 'numero de delitos' del DataFrame resultante.
min_delitos = delitos_por_mes_colonia['numero de delitos'].min()
# Imprimimos el resultado para informar cuál fue el menor número de delitos por mes y colonia.
print("Mientras que el mínimo número de delitos por mes y colonia, en la alcaldía Cuauhtémoc fue de:", min_delitos)

"""Dado que el siguiente paso consiste en clasificar las colonias según su incidencia delictiva mensual, utilizaremos la **Distribución Percentil (Cuantiles)** como método de clasificación. Este enfoque permite dividir los datos en tres niveles proporcionalmente equilibrados: **bajo, medio y alto**, basados en los percentiles del 33% y 66%.

Es especialmente adecuado para distribuciones asimétricas, como lo es en este caso, ya que los registros de delitos tienen este tipo de comportamiento.

Clasificar mediante percentiles garantiza que cada nivel cuente con una representación adecuada, lo que facilita la construcción de los estados para la **cadena de Markov**. Esto no solo mejora la interpretabilidad del modelo, sino que también establece una base robusta para calcular las probabilidades de transición entre niveles de incidencia delictiva. Además, al ser un método adaptable, se ajusta automáticamente a cualquier distribución de datos, eliminando la necesidad de establecer límites arbitrarios.
##Fórmulas
![image.png](data:image/png;base64,)
"""

# Continuamos calculando los percentiles y redondearlos a enteros para el número de delitos por mes
percentiles = delitos_por_mes_colonia['numero de delitos'].quantile([0.33, 0.66]).round().astype(int).to_dict()

# Imprimir los rangos de clasificación
print(f"Rangos de incidencia delictiva para el año 2023:")
print(f"Bajo: <= {percentiles[0.33]} delitos")
print(f"Medio: > {percentiles[0.33]} y <= {percentiles[0.66]} delitos")
print(f"Alto: > {percentiles[0.66]} delitos")

#Respecto a la celda anterior, creamos una función que le asigne el estado a nuestra colonia
# Función para asignar el nivel de incidencia
def asignar_nivel_incicencia(num_delitos):
    if num_delitos <= percentiles[0.33]:
        return 'Bajo'
    elif num_delitos <= percentiles[0.66]:
        return 'Medio'
    else:
        return 'Alto'

# Aplicar la función para añadir el nivel de incidencia
delitos_por_mes_colonia['nivel_incidencia'] = delitos_por_mes_colonia['numero de delitos'].apply(asignar_nivel_incicencia)

# Mostrar el DataFrame con el  nivel de incidencia
print(delitos_por_mes_colonia)

#Dado que para ver de una forma mas practica los datos previamente obtenidos, crearemos un nuevo df, en donde tambien reestructuraremos las columnaas, para que colonia y mes no se repitan
df_estados = delitos_por_mes_colonia.pivot_table(index='colonia', columns='mes', values='nivel_incidencia', aggfunc='first')

df_estados

# Definimos el orden correcto de los meses
orden_meses = ['Enero', 'Febrero', 'Marzo', 'Abril', 'Mayo', 'Junio', 'Julio', 'Agosto', 'Septiembre', 'Octubre', 'Noviembre', 'Diciembre']

# Reordenamos las columnas del DataFrame según el orden cronológico
df_estados = df_estados.reindex(columns=orden_meses) # Change from .loc to .reindex with columns argument

# Mostramos el DataFrame resultante
df_estados

#Observemos que tenemos filas con valores nulos, entonces las eliminaremos
df_estados.dropna(axis=0, how='any', inplace=True)
df_estados

#Descargamos este df eb un csv
df_estados.to_csv('df_estados_2023.csv', index=True)

#Notemos que tenemos ahora un número total de 5 colonias
print("El número total de colonias, depués de elimianr datos nulos es de:", len(df_estados))

"""##Cálculo de las Probabilidades de Transición y sus Matrices correspondientes"""

#Importamos las librerias necesarias
from fractions import Fraction
import pandas as pd

# Comenzamos cargando el CSV a un DataFrame
df = pd.read_csv("//content/df_estados_2023.csv")

# Creamos una lista con los meses en orden
meses = ["Enero", "Febrero", "Marzo", "Abril", "Mayo", "Junio",
         "Julio", "Agosto", "Septiembre", "Octubre", "Noviembre", "Diciembre"]

# Diccionario para almacenar las matrices de transición por mes
matrices_transicion = {}

# Definimos los estados posibles
estados = ['Bajo', 'Medio', 'Alto']

# Calculamos matrices de transición para cada mes
for i in range(len(meses) - 1):  # Iterar de Enero a Noviembre (último mes con transiciones)
    mes_actual = meses[i]
    mes_siguiente = meses[i + 1]

    # Convertimos las columnas de estado en valores numéricos para facilitar la transición
    df[mes_actual] = pd.Categorical(df[mes_actual], categories=estados, ordered=True)
    df[mes_siguiente] = pd.Categorical(df[mes_siguiente], categories=estados, ordered=True)

    # Creamos una tabla de transiciones entre el mes actual y el siguiente
    transiciones = pd.crosstab(df[mes_actual], df[mes_siguiente], normalize='index')

    # Aseguramos que la matriz tenga las filas y columnas correspondientes a "Bajo", "Medio", "Alto"
    transiciones = transiciones.reindex(estados, columns=estados, fill_value=0)

    # Convertimos los valores decimales a fracciones
    transiciones = transiciones.applymap(lambda x: Fraction(x).limit_denominator())

    # Guardamos la matriz de transición en el diccionario
    matrices_transicion[f"{mes_actual} -> {mes_siguiente}"] = transiciones

    # Mostramos la matriz de transición con valores racionales
    print(f"\nMatriz de transición: {mes_actual} -> {mes_siguiente}")
    print(transiciones)

# Mostramos todas las matrices de transición almacenadas
for clave, matriz in matrices_transicion.items():
    print(f"\nMatriz de transición: {clave}")
    print(matriz)

print("Esta matriz muestra cómo el estado de incidencia de los delitos cambia de un mes a otro en el año 2023" )

